module.exports = {"html":"<h1>Challenge accomplished! 😉😉😉</h1>\n<p>Thank you for giving me this chance to challenge myself!  Now, it's time for me to show you my work!</p>\n<h2>The Header</h2>\n<ul>\n<li>Change the styles of both header and footer to make them look nicer.</li>\n<li>Pick the same color of ApplyBoard's logo, applied to the text.</li>\n<li><strong>Bonus:</strong> Not just ripping off your existing header.</li>\n</ul>\n<h2>Welcome Page</h2>\n<ul>\n<li>Design a simple but beautiful 'welcome' page.</li>\n<li>Set up in universal-router and redirect user to this welcome page after clicking 'Log in' button.</li>\n<li><strong>Bonus:</strong> Add 'bounce in' CSS animation for 'WELCOME'!  Wow! 🤗</li>\n</ul>\n<h2>JS Enhancements</h2>\n<ul>\n<li>In 'login' page, as the users typing in the 'name' field, our page says 'Hello' with their names in real time!</li>\n<li><strong>Bonus:</strong> As users typing in 'name' field, we give autocomplete suggestions to save their time!  Try your name! 😋</li>\n</ul>\n<h2>Redux Time</h2>\n<ul>\n<li>Using redux to pass user's name from 'login' component to 'welcome' component (first, store the name in redux store; second, pass the name from redux store to props within welcome component), so that we can give a unique and warm welcome to our user by displaying his/her name!</li>\n<li><strong>Bonus:</strong> Display &quot;Your name has x characters!&quot; as a subtitle in welcome page.  (The length of name is counted prior to storing; space doesn't count as a character.)</li>\n<li><strong>Bonus:</strong> This subtitle also has a 'fade in' animation!</li>\n</ul>\n<h2>NEW FEATURE! 😎</h2>\n<ul>\n<li><strong>Bonus:</strong> If users directly access 'welcome' page or leave the 'name' field empty when clicking 'Login' button, 'WELCOME GUEST' will be displayed in 'welcome' page.  Also, the subtitle is not displayed in this case (No sense to count how many characters for 'GUEST', right?).</li>\n</ul>\n<h1>Welcome to <a href=\"http://applyboard.com/\">Applyboard's</a> React Challenge 😬 <a href=\"https://twitter.com/applyboard\"><img src=\"https://img.shields.io/twitter/follow/applyboard.svg?style=social&label=Follow\" height=\"20\"></a></h1>\n<p>Thanks for applying to work with us here at Applyboard! Here's a little challenge to play around with so we can see what you come up with!</p>\n<p>It's a solid starting point for you to get an idea of what we work with every day at Applyboard in order to help international students realize their futures.</p>\n<h1>Getting Started</h1>\n<h2>Requirements</h2>\n<ul>\n<li>Mac OS X, Windows, or Linux</li>\n<li><a href=\"https://yarnpkg.com/\">Yarn</a> package + <a href=\"https://nodejs.org/\">Node.js</a> v6.5 or newer</li>\n<li>Text editor or IDE pre-configured with React/JSX/Flow/ESlint (<a href=\"./how-to-configure-text-editors.md\">learn more</a>)</li>\n</ul>\n<h2>Directory Layout</h2>\n<p>Before you start, take a moment to see how the project structure looks like:</p>\n<pre><code>.\n├── /build/                     # The folder for compiled output\n├── /docs/                      # Documentation files for the project\n├── /node_modules/              # 3rd-party libraries and utilities\n├── /public/                    # Static files which are copied into the /build/public folder\n├── /src/                       # The source code of the application\n│   ├── /components/            # React components\n│   ├── /data/                  # GraphQL server schema and data models\n│   ├── /routes/                # Page/screen components along with the routing information\n│   ├── /client.js              # Client-side startup script\n│   ├── /config.js              # Global application settings\n│   ├── /server.js              # Server-side startup script\n│   └── ...                     # Other core framework modules\n├── /test/                      # Unit and end-to-end tests\n├── /tools/                     # Build automation scripts and utilities\n│   ├── /lib/                   # Library for utility snippets\n│   ├── /build.js               # Builds the project from source to output (build) folder\n│   ├── /bundle.js              # Bundles the web resources into package(s) through Webpack\n│   ├── /clean.js               # Cleans up the output (build) folder\n│   ├── /copy.js                # Copies static files to output (build) folder\n│   ├── /deploy.js              # Deploys your web application\n│   ├── /postcss.config.js      # Configuration for transforming styles with PostCSS plugins\n│   ├── /run.js                 # Helper function for running build automation tasks\n│   ├── /runServer.js           # Launches (or restarts) Node.js server\n│   ├── /start.js               # Launches the development web server with &quot;live reload&quot;\n│   └── /webpack.config.js      # Configurations for client-side and server-side bundles\n├── Dockerfile                  # Commands for building a Docker image for production\n├── package.json                # The list of 3rd party libraries and utilities\n└── yarn.lock                   # Fixed versions of all the dependencies\n</code></pre>\n<h2>Quick Start</h2>\n<h3>1. Get the latest version</h3>\n<p>You can start by cloning the latest version of this project on your\nlocal machine by running:</p>\n<pre><code class=\"language-shell\">$ git clone \\\n      https://github.com/TobyApplyBoard/reactSample.git\n$ cd reactSample\n</code></pre>\n<h3>2. Run <code>yarn install</code></h3>\n<p>This will install both run-time project dependencies and developer tools listed\nin <a href=\"../package.json\">package.json</a> file.</p>\n<h3>3. Run <code>yarn start</code></h3>\n<p>This command will build the app from the source files (<code>/src</code>) into the output\n<code>/build</code> folder. As soon as the initial build completes, it will start the\nNode.js server (<code>node build/server.js</code>) and <a href=\"https://browsersync.io/\">Browsersync</a>\nwith <a href=\"https://webpack.github.io/docs/hot-module-replacement\">HMR</a> on top of it.</p>\n<blockquote>\n<p><a href=\"http://localhost:3000/\">http://localhost:3000/</a> — Node.js server (<code>build/server.js</code>)\nwith Browsersync and HMR enabled<br>\n<a href=\"http://localhost:3000/graphql\">http://localhost:3000/graphql</a> — GraphQL server and IDE<br>\n<a href=\"http://localhost:3001/\">http://localhost:3001/</a> — Browsersync control panel (UI)</p>\n</blockquote>\n<p>Now you can open your web app in a browser, on mobile devices and start\nhacking away. Whenever you modify any of the source files inside the <code>/src</code> folder,\nthe module bundler (<a href=\"http://webpack.github.io/\">Webpack</a>) will recompile the\napp on the fly and refresh all the connected browsers.</p>\n<p>Note that the <code>yarn start</code> command launches the app in <code>development</code> mode,\nthe compiled output files are not optimized and minimized in this case.</p>\n<h1>The Challenge 😏</h1>\n<p>The challenge consists of four parts. They slowly increase in difficulty so you can warm up 😊 - This shouldn't take too long, but we get that you might be busy so you get 6x the amount of time our devs got to complete this challenge (1 hr 30 min).</p>\n<h2>The Header (10 min)</h2>\n<p><i>The header is the default style for the react-starter-kit that I bootlegged.</i></p>\n<p><strong>Task:</strong>\nRedesign this to reflect ApplyBoard's colors (with our logo).</p>\n<p><strong>Tip:</strong> Bonus points for not totally ripping off our existing header on our site.</p>\n<h2>Welcome Page (45 min)</h2>\n<p><i>In the /login route (localhost:3000/login), you'll notice that clicking on Log in doesn't do anything. We want it to direct the user to a &quot;Welcome&quot; page.</i></p>\n<p><strong>Task:</strong> Design a beautiful &quot;welcome&quot; page. Hook it up in universal-router and redirect the user to the route when they click &quot;Log in&quot;.</p>\n<p><strong>Tip:</strong> Ensure to use universal-router and not just a simple href! You'll need to hook up universal-router properly for this in order to proceed to the next task!</p>\n<p><strong>Bonus:</strong>\nAdd cool CSS animations (react-animations or bodymovin). Check out <a href=\"https://codepen.io/collection/nVYWZR/\">https://codepen.io/collection/nVYWZR/</a> for examples that'll to blow your mind</p>\n<h2>JS Enhancements (5 min)</h2>\n<p><i>Let's make our login page slightly more cool shall we? We want it to &quot;talk&quot; to our users.</i></p>\n<p><strong>Task 1:</strong> Notice how the title for /login just states &quot;Hello&quot;. Modify this to reflect the User's name as they type. ie. if I type &quot;Toby&quot; in the &quot;name&quot; field, I want the title to update in real time to &quot;Hello Toby&quot;.</p>\n<p><strong>Tip:</strong> Do ya really need a tip for this?</p>\n<p><strong>Bonus:</strong> disable browser based autocomplete/suggestions, and implement react-autocomplete (make up a set of sample data) on the &quot;Name&quot; field.</p>\n<h2>Redux Time (30 min)</h2>\n<p><i>  Let's show our users that we care and can remember who they are when they navigate to a different route.</i></p>\n<p><strong>Task 1:</strong> Upon clicking login, we want to pass the user's name to the welcome page that you've created. Use redux to store and pass this data to your new welcome page and display their name on that page (ie. &quot;Welcome Toby!&quot;)</p>\n<p><strong>Tip:</strong> Though passing this little bit of data is simple, please use redux properly and access your data from within the welcome page component!</p>\n<p><strong>Bonus:</strong> Just as a bonus, access the user's name that you've stored in Task 2 from the welcome component's parent. Count the number of characters in their name (either as an action prior to storing or after fetching) and pass it as a prop to your Welcome component - Then display the count as a subtitle (&quot;Your name has x characters!&quot;).</p>\n<h1>SUBMISSIONS 🏁</h1>\n<p>Submitting should be simple.</p>\n<p>Just create a new repo under your account and link me to it (send me the link - <a href=\"mailto:toby@applyboard.com\">toby@applyboard.com</a>).</p>\n<p>Alternatively if you don't want the world to see your solution, you could just compress it as a .zip, host it somewhere and link me to that as well.</p>\n<h1>Not your cup of tea?</h1>\n<p>That's alright. I get that sometimes front end dev is hard. Come join our back end team or our sales team instead!</p>\n<p>Check out our career page for more :)</p>\n<h2>Additional Resources</h2>\n<ul>\n<li><a href=\"http://facebook.github.io/react/\">Getting Started with React.js</a></li>\n<li><a href=\"http://redux.js.org/\">Getting Started Redux.js</a></li>\n<li><a href=\"https://github.com/kriasoft/universal-router\">About Universal-Router</a></li>\n<li><a href=\"http://stackoverflow.com/questions/tagged/reactjs\">React.js Questions on StackOverflow</a></li>\n<li><a href=\"https://discuss.reactjs.org/\">React.js Discussion Board</a></li>\n<li><a href=\"http://flowtype.org/\">Flow — A static type checker for JavaScript</a></li>\n<li><a href=\"https://github.com/reactjs/react-future\">The Future of React</a></li>\n<li><a href=\"https://babeljs.io/docs/learn-es6/\">Learn ES6</a>, <a href=\"https://github.com/lukehoban/es6features#readme\">ES6 Features</a></li>\n</ul>\n<h2>Support</h2>\n<ul>\n<li>Twitter: <a href=\"twitter.com/guutoby\">@guutoby</a> - ask me questions here if you want to wait forever a reply.</li>\n<li>Email: <a href=\"mailto:toby@applyboard.com\">toby@applyboard.com</a> ask me questions here if you want a response within 12 hrs.</li>\n<li>Instagram: <a href=\"https://instagram.com/guutoby\">@guutoby</a> - for ideas on how to sweet talk me during the our interview</li>\n</ul>\n<hr>\n<p>Hacked together with ♥ by Toby Gu based off of the <a href=\"https://github.com/kriasoft/react-starter-kit\">react-starter-kit</a></p>\n<p>[rsk]: <a href=\"https://www.reactstarterkit.com\">https://www.reactstarterkit.com</a>\n<br>\n[demo]: <a href=\"http://demo.reactstarterkit.com\">http://demo.reactstarterkit.com</a>\n<br></p>\n"};

